import React from 'react';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import {MainPage} from './pages/MainPage';
import {AddNewPokemonPage} from './pages/AddNewPokemonPage';

export const Routes = () => {
	return (
		<Router>
			<Switch>
				<Route path="/" exact>
					<MainPage />
				</Route>
				<Route path="/add" >
					<AddNewPokemonPage />
				</Route>
			</Switch>
		</Router>

	);
}
